objetoCompra:
Serviço de Limpeza e desinfecção do Poço Artesiano tubular localizado na Procuradoria do Trabalho no Município de Santarém/PA, com fornecimento de materiais, compreendendo:
- Mobilização e Desmobilização (retirada e reposição de equipamentos de bombeamento do
poço);
- Limpeza e Desinfecção do Poço;
- Emissão de Anotação de Responsabilidade Técnica – ART; 
- Coleta e Análise físico-químicos e bacteriológicos da Água do Poço, com a emissão do respectivo laudo.
